import{_ as e,o,c as a,O as t}from"./chunks/framework.9482e208.js";const b=JSON.parse('{"title":"§ 29.1-738.1 Analysis of breath to determine alcohol content of blood.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/29.1-738.1.md","filePath":"vacode/29.1-738.1.md"}'),r={name:"vacode/29.1-738.1.md"},n=t('<h1 id="§-29-1-738-1-analysis-of-breath-to-determine-alcohol-content-of-blood" tabindex="-1">§ 29.1-738.1 Analysis of breath to determine alcohol content of blood. <a class="header-anchor" href="#§-29-1-738-1-analysis-of-breath-to-determine-alcohol-content-of-blood" aria-label="Permalink to &quot;§ 29.1-738.1 Analysis of breath to determine alcohol content of blood.&quot;">​</a></h1><p>Any person who is suspected of a violation of subsection B of § <a href="http://law.lis.virginia.gov/vacode/29.1-738/" target="_blank" rel="noreferrer">29.1-738</a> or § <a href="http://law.lis.virginia.gov/vacode/29.1-738.02/" target="_blank" rel="noreferrer">29.1-738.02</a> shall be entitled, if such equipment is available, to have a preliminary breath analysis for the purpose of obtaining an analysis of the probable alcohol content of his blood. The procedures and requirements of § <a href="http://law.lis.virginia.gov/vacode/18.2-267/" target="_blank" rel="noreferrer">18.2-267</a> shall apply, mutatis mutandis.</p><p>1989, c. 726; 1996, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0631" target="_blank" rel="noreferrer">631</a>.</p>',3),l=[n];function i(s,c,h,d,f,_){return o(),a("div",null,l)}const m=e(r,[["render",i]]);export{b as __pageData,m as default};
